            {/* <div className="rating-box rating-one"></div>
            <div className="rating-box"></div>
            <div className="rating-box"></div> */}
            <Box  className="rating-box rating-one" stars={values[0].stars} review={values[0].review} imgg={values[0].img}></Box>
            <Box className="rating-box" stars={values[1].stars} review={values[1].review} imgg={values[1].img}></Box>
            <Box className="rating-box" stars={values[2].stars} review={values[2].review} imgg={values[2].img}></Box>
        </div>
    </div>
    )
}
export default Rating;
